import React from 'react';

const players = [
  {
    id: 1,
    name: 'Adam Akimey',
    team: 'Helsingborg vs. Ume책',
    rating: 9.7,
    img: 'https://via.placeholder.com/32',
  },
  {
    id: 2,
    name: 'Wessam Abou Ali',
    team: 'Porto vs. Al Ahly',
    rating: 9.3,
    img: 'https://via.placeholder.com/32',
  },
  {
    id: 3,
    name: 'Achraf Hakimi',
    team: 'Seattle vs. PSG',
    rating: 8.7,
    img: 'https://via.placeholder.com/32',
  },
  {
    id: 4,
    name: 'Facundo Ferrero',
    team: 'Nueva Chicago vs. Col처n',
    rating: 8.7,
    img: 'https://via.placeholder.com/32',
  },
  {
    id: 5,
    name: 'Yaqub Finey',
    team: 'Sundsvall vs. Trelleborg',
    rating: 8.7,
    img: 'https://via.placeholder.com/32',
  },
];

function TopPlayers() {
  return (
    <div className="bg-gray-800 p-4 rounded shadow text-white mb-4">
      <h2 className="text-lg font-semibold mb-2">Top Players</h2>

      {/* Heatmap Fake */}
      <div className="mb-3">
        <img
          src="https://via.placeholder.com/300x150/00FF0066/000000?text=Heatmap"
          alt="Heatmap"
          className="rounded"
        />
      </div>

      <ul>
        {players.map((player, index) => (
          <li key={index} className="flex items-center justify-between py-1 hover:bg-gray-700 px-2 rounded">
            <div className="flex items-center gap-2">
              <span>{player.id}.</span>
              <img src={player.img} alt={player.name} className="w-6 h-6 rounded-full" />
              <span>{player.name}</span>
              <span className="text-gray-400 text-xs">{player.team}</span>
            </div>
            <span className="bg-blue-600 text-white text-xs px-2 py-1 rounded">{player.rating}</span>
          </li>
        ))}
      </ul>

      <button className="mt-2 text-sm text-blue-400 hover:underline">Show more</button>
    </div>
  );
}

export default TopPlayers;
